// Variable global para la instancia del mapa
let mapaModalInstance = null;

// --- ELEMENTOS DEL DOM ---
const contenedorCategorias = document.getElementById('contenedor-categorias');
const modal = document.getElementById('modal-agencia-detalle');
const spanCerrar = document.getElementsByClassName("cerrar-modal")[0];

// --- 1. RENDERIZADO POR CATEGORÍAS ---

/**
 * Agrupa las agencias por su categoría.
 * @param {Array} agencias - Lista de objetos de agencia.
 * @returns {Object} Objeto donde las claves son las categorías.
 */
function agruparPorCategoria(agencias) {
    return agencias.reduce((acc, agencia) => {
        const categoria = agencia.categoria;
        if (!acc[categoria]) {
            acc[categoria] = [];
        }
        acc[categoria].push(agencia);
        return acc;
    }, {});
}

/**
 * Crea el HTML para una sola tarjeta.
 */
function crearTarjetaHTML(agencia) {
    return `
        <button class="tarjeta-negocio" data-agencia-id="${agencia.id}">
            <div class="imagen-negocio">
                <img src="${agencia.logo}" alt="Logo de ${agencia.nombre}">
            </div>
            <div class="info-negocio">
                <p class="nombre-distribuidora"><strong>${agencia.nombre}</strong></p>
                <p class="categoria-distribuidora">Categoría: ${agencia.categoria}</p>
                <p class="direccion-tarjeta">${agencia.direccion.substring(0, 40)}...</p>
            </div>
        </button>
    `;
}

/**
* Renderiza todas las categorías y sus tarjetas en el DOM.
* @param {Array} agencias - El array de agencias A MOSTRAR (puede ser completo o filtrado).
*/
// ⚠️ CORRECCIÓN CLAVE: AHORA ACEPTA EL ARRAY 'agencias'
function renderizarTarjetasPorCategoria(agencias) {
    // ⚠️ CORRECCIÓN: Usar el argumento 'agencias' y verificar si está vacío
    if (!agencias || agencias.length === 0) {
        contenedorCategorias.innerHTML = '<p class="sin-resultados">No se encontraron agencias que coincidan con la búsqueda o categoría.</p>';
        return;
    }

    // ⚠️ CORRECCIÓN: Usar el argumento 'agencias' para agrupar
    const agenciasAgrupadas = agruparPorCategoria(agencias);
    let htmlFinal = '';

    for (const categoria in agenciasAgrupadas) {
        // 1. Crear el encabezado de la categoría
        htmlFinal += `
            <section class="seccion-categoria">
                <h2 class="titulo-categoria">${categoria}</h2>
                <div class="lista-tarjetas" data-categoria="${categoria}">
        `;

        // 2. Crear las tarjetas dentro de la categoría
        agenciasAgrupadas[categoria].forEach(agencia => {
            htmlFinal += crearTarjetaHTML(agencia);
        });

        htmlFinal += `
                </div>
            </section>
        `;
    }

    contenedorCategorias.innerHTML = htmlFinal;
    agregarListenersTarjeta(); // Añadir la interactividad
}

// --- 2. GESTIÓN DEL MODAL Y GOOGLE MAPS ---

/**
 * Carga o actualiza el mapa de Google Maps en el modal.
 */
function cargarMapaEnModal(agencia) {
    const ubicacion = { lat: agencia.coordenadas.lat, lng: agencia.coordenadas.lng };
    const mapaElemento = document.getElementById('mapa-modal');

    // Si el mapa ya existe, solo reajustamos
    if (mapaModalInstance) {
        mapaModalInstance.setCenter(ubicacion);
        // Borrar marcador anterior
        if (mapaModalInstance.marker) {
            mapaModalInstance.marker.setMap(null);
        }
    } else {
        // Inicializar el mapa por primera vez
        mapaModalInstance = new google.maps.Map(mapaElemento, {
            center: ubicacion,
            zoom: 15,
            mapTypeId: 'roadmap'
        });
    }

    // Agregar el nuevo marcador
    mapaModalInstance.marker = new google.maps.Marker({
        position: ubicacion,
        map: mapaModalInstance,
        title: agencia.nombre + ' (Sede Principal)'
    });
}

/**
 * Llena el contenido del modal con los datos de la agencia seleccionada.
 */
function llenarModal(agencia) {
    // 1. Llenar información estática
    document.getElementById('modal-logo').src = agencia.logo;
    document.getElementById('modal-nombre').textContent = agencia.nombre;
    document.getElementById('modal-categoria').textContent = agencia.categoria;
    document.getElementById('modal-descripcion').textContent = agencia.descripcion;
    document.getElementById('modal-direccion-principal').textContent = agencia.direccion;

    // 2. Galería de Imágenes (asumimos 3 imágenes)
    const galeria = document.getElementById('galeria-productos-modal');
    galeria.innerHTML = agencia.imagenes
        .slice(0, 3) // Asegurar que solo tome las primeras 3
        .map(src => `<img src="${src}" alt="Imagen de ${agencia.nombre}">`)
        .join('');



    // 4. Botones de Acción
    const whatsappLink = `https://wa.me/${agencia.whatsapp}?text=Hola, me gustaría más información sobre ${agencia.nombre} (ID: ${agencia.id}).`;
    document.getElementById('modal-boton-whatsapp').href = whatsappLink;




    modal.style.display = "block"; // Mostrar el modal
    document.body.style.overflow = "hidden"; // Bloquear scroll de fondo

    // 5. Cargar Mapa (retardo/reajuste necesario después de mostrar el modal)
    setTimeout(() => {
        // Verificar que Google Maps se haya cargado antes de llamar a la función
        if (typeof google !== 'undefined' && typeof google.maps !== 'undefined') {
            cargarMapaEnModal(agencia);
            // Esto es crucial para que el mapa se renderice correctamente dentro del modal
            if (mapaModalInstance) {
                google.maps.event.trigger(mapaModalInstance, 'resize');
                mapaModalInstance.setCenter({ lat: agencia.coordenadas.lat, lng: agencia.coordenadas.lng });
            }
        }
    }, 100);
}

// Variable global para el mapa dentro del modal
let mapaModal = null;

// ... (dentro de tu script tag) ...

// Lógica de apertura de modal (llamada por clic en tarjeta o marcador)
window.abrirModal = function (agenciaId) {
    const agencia = datosAgencias.find(a => a.id === agenciaId);
    if (!agencia) return;

    // 1. Destacar el marcador y la tarjeta (se mantiene)
    destacarMarcador(agenciaId);

    // 2. Llenar datos del modal (se mantiene)
    document.getElementById('modal-logo').src = agencia.logo;
    document.getElementById('modal-nombre').textContent = agencia.nombre;
    document.getElementById('modal-categoria').textContent = `Categoría: ${agencia.categoria}`;
    document.getElementById('modal-id').textContent = agencia.id;
    // <--- Carga de la DIRECCIÓN en el modal --->
    document.getElementById('modal-direccion').textContent = agencia.direccion;
    // <------------------------------------------>

    const whatsappLink = document.getElementById('modal-whatsapp');
    if (agencia.whatsapp && agencia.whatsapp !== "NO TIENE") {
        const numeroLimpio = agencia.whatsapp.replace(/[^0-9]/g, '');
        whatsappLink.href = `https://wa.me/${numeroLimpio}`;
        whatsappLink.style.display = 'inline-block';
    } else {
        whatsappLink.style.display = 'none';
    }

    // 3. Mostrar el modal (se mantiene)
    const modal = document.getElementById('modal-agencia-detalle');
    modal.classList.add('visible');

    // 4. Inicializar y centrar el mapa dentro del modal
    // Usamos setTimeout para asegurar que el div es visible antes de intentar cargar el mapa
    setTimeout(() => {
        // Coordenadas de la agencia
        const posicion = new google.maps.LatLng(agencia.coordenadas.lat, agencia.coordenadas.lng);

        // Inicializar el mapa, o re-centrar si ya existe
        mapaModal = new google.maps.Map(document.getElementById('mapa-modal'), {
            center: posicion,
            zoom: 16, // Zoom más cercano para el detalle
            mapTypeId: google.maps.MapTypeId.ROADMAP
        });

        // Colocar un marcador específico en el mapa del modal
        new google.maps.Marker({
            position: posicion,
            map: mapaModal,
            title: agencia.nombre,
        });

    }, 200); // Pequeño retraso para asegurar que el modal se ha abierto
}

