/**
 * Agrega el listener de clic a todas las tarjetas generadas.
 */
function agregarListenersTarjeta() {
    document.querySelectorAll('.tarjeta-negocio').forEach(tarjeta => {
        tarjeta.addEventListener('click', function () {
            const agenciaId = this.dataset.agenciaId;
            const agenciaSeleccionada = datosAgencias.find(a => a.id === agenciaId);

            if (agenciaSeleccionada) {
                llenarModal(agenciaSeleccionada);
            }
        });
    });
}

